import React, { useState, useEffect } from "react";

import { updateParameter } from "../src/helpers/update";
import {
  MakeCar,
  ModelMake,
  VersionModel,
  Vehicles,
} from "../src/services/requests";

const Select = ({ label, options, ...rest }) => {
  console.log(...rest);
  return (
    <label className="label-select">
      <span>{label}</span>
      <select {...rest} className="input">
        {options.map(({ label, value }) => (
          <option key={value} value={value}>
            {label}
          </option>
        ))}
      </select>
    </label>
  );
};
function Page({ GetMakeCar, filtrar, query }) {
  return (
    <>
      <form>
        <input></input>
        <select className="input" name="grade_group">
          <option></option>
        </select>
        <select className="input" name="grade_group">
          <option></option>
        </select>
        {/* <select
          defaultValue={tableSelect}
          className="input"
          onChange={(e) => {
            const value = e.currentTarget.value;
            const url = updateParameter(window.location.href, "table", value);
            window.location = url;
          }}
        ></select> */}
        <Select
          className="releases__select"
          label="Disciplina:"
          options={GetMakeCar}
          onChange={(e) => {
            e.target.value;
          }}
        ></Select>
        <select className="input" name="grade_group">
          <option></option>
        </select>
        <select className="input" name="grade_group">
          <option></option>
        </select>
        <select className="input" name="grade_group">
          <option></option>
        </select>
      </form>
    </>
  );
}

Page.getInitialProps = async ({ query }) => {
  let filtrar = [];

  const GetMakeCar = await MakeCar();
  // const GetModelMake = await ModelMake();
  // const GetVersionModel = await VersionModel();
  // const GetVehicles = await Vehicles();
  return {
    filtrar,
    query,
    GetMakeCar,
  };
};

export default Page;
